import React from 'react';
import '../../src/Style/personal_loan.css';

const PersoanlLoan = () => {

    const homeLoanStyle = {
        borderRadius:"10px",
        backgroundPosition:"center",
        backgroundSize:"cover",
        backgroundImage: `url('./logo192.png')`,
        backgroundColor:'red',
    };

    
    return(  
        <div>
            
            <div className='personalLoanPromo'>
                <h1>Get pre approved personal loan!</h1>

                <p>Safeguard Bank's online personal loan EMI calculator makes it easy for you to figure out the monthly instalments on your loan. </p>

                <p>When you take a loan, the equated monthly instalment is a key factor in deciding the loan amount and tenure.
                    The personal loan calculator helps you instantly calculate your pay-outs and, therefore, plan your loan and repayment better. </p>

                 <p> To calculate your EMI, just enter the loan amount, rate of interest (13%) and loan tenure in months, and your EMI is instantly displayed. If you wish to lower your EMI, you can do so by reducing the loan amount or the interest rate or by increasing the tenure. 
                     If you can afford higher monthly payments, you could consider increasing the loan amount or reducing your tenure.   </p>
                
            </div>
            <div className='personalLoanPromo1'>
                   test image
            </div>
            <div style={homeLoanStyle}  className="home-loan">
            </div>    

        </div>
    );

};

export default PersoanlLoan;
